import React from "react";

const Navbar = () => {
  return (
    <div className="navbar-container">
      <a href="">Home</a>
      <a href="">Work</a>
      <a href="">Contact</a>
      <a href="">Testimonials</a>
      <button className="primary-button">Bookings Now</button>
    </div>
  );
};

export default Navbar;
